print("start..")

def get_rgb888_from_rgb565(rgb565):
    r = (rgb565 & 0xf800) >> 8
    g = (rgb565 & 0x07e0) >> 3
    b = (rgb565 & 0x001f) << 3
    return r, g, b


for color in hds2xx_colors_565:
    r, g, b = get_rgb888_from_rgb565(color)
    lv_color = lv.color_make(0x55, 0x55, 0x55)
    lv_color.ch.red = r
    lv_color.ch.green = g
    lv_color.ch.blue = b
    hds2xx_lv_colors.append(lv_color)


